import { IconButton } from "@mui/material";
import axios from "axios";
import { useState } from "react";
import ThumbUpIcon from "@mui/icons-material/ThumbUp";

export const LikeOrDis = ({params}) => {
  const [like, setLike] = useState(false);

  const handleLike = () => {
    setLike(true);
    axios
      .put(`http://localhost:3001/api/nft/like/${params.id}`, { like: true })
      .then((res) => {
        console.log(res);
      })
      .catch((err) => {
        console.log(err);
      });
  };
  return (
    <IconButton
      style={{
        backgroundColor: like ? "green" : "",
        color: like ? "white" : "",
      }}
      onClick={handleLike}
    >
      <ThumbUpIcon />
    </IconButton>
  );
};
